import React from 'react'
import { useFeed } from './util/hooks'

const Feed = () => {
  const { object } = useFeed()


  return (
    object ? (
      <>
        {object.map((item, i) => {
          <li key={i}>
            <p>item</p>
          </li>
        })}
      </>
    ): null
  )
}

export default Feed
